export function createValidationRule<TResult>(
	_ruleName: string,
	description: string,
	messageId: string,
	config: ImportValidationConfig<TResult>,
): RuleModule<string, readonly string[]> {
	return ESLintUtils.RuleCreator.withoutDocs({
		meta: {
			type: "problem",
			docs: {
